import React ,{Component}from 'react';
import { Platform,Alert,Text, View, Image,SafeAreaView,ScrollView,TouchableOpacity,Modal,ActivityIndicator } from 'react-native';
import {styles} from '../providerStyle';
import DataContext from '../../providerContext';
import CalendarPicker from 'react-native-calendar-picker';
import moment from 'moment';
import I18n from '../switchLanguage';

export default class ProcessingOrder extends Component {
    constructor(props) {
      super(props);
      this.state={
        data:[],
        time:[],
        isEnabled: false,
        modalVisible: false,
        mdVisible:false,
        mds:[],
        Visible:false,
        selectedId:'',
        selectedDoctor:'',
        timeLoad:false,
        isLoading:true,
        selectedDate: new Date(),
      };
      this.onDateChange = this.onDateChange.bind(this);
    }

  /*
} */
  componentDidMount = () => {
    this._unsubscribe = this.props.navigation.addListener('focus', () => {this.query()});
  }

  setIsEnabled = (value) => {
    this.setState({isEnabled: value})
  }
  setModalVisible = (value) => {
    this.setState({modalVisible: value})
  }
  setMdVisible = (value) => {
    this.setState({mdVisible: value})
  }
  setVisible = (visible) => {
    this.setState({ Visible: visible });
  }
  formatDate(date) {
    var d = new Date(date),
        month = '' + (d.getMonth() + 1),
        day = '' + d.getDate(),
        year = d.getFullYear();

    if (month.length < 2)
        month = '0' + month;
    if (day.length < 2)
        day = '0' + day;

    return [year, month, day].join('-');
  }

  sendRequest(date){
    this.setState({timeLoad:true})
    let url = 'http://'
    +this.context.url
    +'/aicare-business-api/business/user/scheduledetail?date='
    + date +'&businessEmployerId=' + this.state.selectedDoctor + '&status=0';
      fetch(url,{
        method: 'GET',
        mode: 'cors',
        credentials: 'include',
        headers: {
        'Accept':       'application/json',
        'Content-Type': 'application/json',
        'sso-auth-token': this.context.token,
        'sso-refresh-token': this.context.refresh_token,
      }})
      .then((response) => response.json())
      .then((json) => {
        this.setState({timeLoad:false});
        if (json.code === 0) {
          console.log(json.msg);
          this.setState({time:json.data});
        } else {
          console.log(json.msg);
        }
      }).catch(error => console.warn(error));
  }

  modify(sid,stime,etime) {
    Alert.alert(
      '提醒',
      '您确定要修改预约至'+stime+' - ' +etime+'吗？',
      [
        {text: '确定', onPress: () => {
          this.setState({isLoading:true})
          let url = 'http://'
          +this.context.url
          +'/aicare-business-api/business/appointment/modify?'
          +'id=' + this.state.selectedId
          +'&scheduleDetailedId=' + sid;
            fetch(url,{
              method: 'GET',
              mode: 'cors',
              credentials: 'include',
              headers: {
              'Accept':       'application/json',
              'Content-Type': 'application/json',
              'sso-auth-token': this.context.token,
              'sso-refresh-token': this.context.refresh_token,
            }
            })
            .then((response) => response.json())
            .then((json) => {
              if (json.code === 0) {
                this.setState({isLoading:true})
                Alert.alert('修改成功')
                this.queryOrders();
              } else {
                this.setState({isLoading:true})
                Alert.alert('修改失败')
                this.queryOrders();
              }
            }).catch(error => console.warn(error));
        }},
        {text: '取消', onPress: () => console.log('no button clicked'),style: "cancel"},
      ],
      {
        cancelable: false
      }
    );
}
  onDateChange(date) {
    let fd = this.formatDate(date);
    this.sendRequest(fd);
  }

  findvis(id) {
    for (let i=0;i<this.state.mds.length;i++) {
      if(this.state.mds[i].id == id) {
        return this.state.mds[i].visible;
      }
    }
  }
  changevis(id,value){
    for (let i=0;i<this.state.mds.length;i++) {
      if(this.state.mds[i].id == id) {
        let t = this.state.mds;
        t[i].visible = value;
        this.setState({mds:t})
      }
    }
  }
  queryDate = (date) =>{
    this.setState({
      modalVisible:false,
      isLoading:true,
      selectedDate: date,
    });
    let tp = 1;
    if (this.context.employerId !=null) {
      tp = 2;
    }
    let fd = this.formatDate(date);
      let url = 'http://'
      +this.context.url
      +'/aicare-business-api/business/appointment/query?status=3'
      + '&type=' + tp
      + '&appointDate=' + fd
      + '&dateFlg=1';
        fetch(url,{
          method: 'GET',
          mode: 'cors',
          credentials: 'include',
          headers: {
          'Accept':       'application/json',
          'Content-Type': 'application/json',
          'sso-auth-token': this.context.token,
          'sso-refresh-token': this.context.refresh_token,
        }})
        .then((response) => response.json())
        .then((json) => {
          this.setState({isLoading:false})
          if (json.code === 0) {
            console.log(json);
            this.setState({data:json.page});
            for(let i=0; i<json.page.length;i++){
              var d= {
                id:json.page[i].id,
                visible:false,
              }
              let t = this.state.mds;
              t.push(d);
              this.setState({mds:t});
            }
          } else {
            console.log(json.msg)
          }
        }).catch(error => console.warn(error));
  }
  query() {
    this.setState({isLoading:true})
    let tp = 1;
    if (this.context.employerId !=null) {
      tp = 2;
    }
    let url = 'http://'
    +this.context.url
    +'/aicare-business-api/business/appointment/query?status=3'
    + '&type=' + tp;
      fetch(url,{
        method: 'GET',
        mode: 'cors',
        credentials: 'include',
        headers: {
        'Accept':       'application/json',
        'Content-Type': 'application/json',
        'sso-auth-token': this.context.token,
        'sso-refresh-token': this.context.refresh_token,
      }})
      .then((response) => response.json())
      .then((json) => {
        this.setState({isLoading:false})
        if (json.code === 0) {
          console.log(json);
          this.setState({data:json.page});
          for(let i=0; i<json.page.length;i++){
            var d= {
              id:json.page[i].id,
              visible:false,
            }
            let t = this.state.mds;
            t.push(d);
            this.setState({mds:t});
          }
        } else {
          console.log(json.msg)
        }
      }).catch(error => console.warn(error));
  }
  queryType(type){
    this.setState({
      Visible:false,
      isLoading:true,
      selectedType:type,
    });
    let tp = 1;
    if (this.context.employerId !=null) {
      tp = 2;
    }
      let url = 'http://'
      +this.context.url
      +'/aicare-business-api/business/appointment/query?status=3'
      + '&type=' + tp
      + '&deptId=' + type
        fetch(url,{
          method: 'GET',
          mode: 'cors',
          credentials: 'include',
          headers: {
          'Accept':       'application/json',
          'Content-Type': 'application/json',
          'sso-auth-token': this.context.token,
          'sso-refresh-token': this.context.refresh_token,
        }})
        .then((response) => response.json())
        .then((json) => {
          this.setState({isLoading:false})
          if (json.code === 0) {
            console.log(json);
            this.setState({data:json.page});
            for(let i=0; i<json.page.length;i++){
              var d= {
                id:json.page[i].id,
                visible:false,
              }
              let t = this.state.mds;
              t.push(d);
              this.setState({mds:t});
            }
          } else {
            console.log(json.msg)
          }
        }).catch(error => console.warn(error));
  }

  render () {
    var date = new Date(this.state.selectedDate).getDate();
    var month = new Date(this.state.selectedDate).getMonth() + 1;
    let times=[];
    if (this.state.time.length >0) {
    times = this.state.time.map((item) => {
      return (
        <View style={{height:30,
        width:'auto',
        paddingLeft:15,
        paddingRight:15,
        marginTop:5,
        marginBottom:5,
        marginLeft: 10,
        marginRight: 10,
        borderRadius:10,
        backgroundColor:'#8FD7D3',
        alignItems: 'center',
        justifyContent: 'center'}} key={item.id}>
          <TouchableOpacity onPress={() => {this.modify(item.scheduleDetailedId,item.startTime.substring(0,5),item.endTime.substring(0,5));}}>
            <Text style={{color:'white'}}>{item.startTime.substring(0,5)}-{item.endTime.substring(0,5)}</Text>
          </TouchableOpacity>
        </View>
      )
    })}
    let orders;
    if (this.state.isLoading){
      return(
        <View style={{ flex: 1, backgroundColor:'rgb(51,51,51)', justifyContent: "center", alignItems: "center" }}>
          <ActivityIndicator size="large" color="white"  />
        </View>
    )
    }else {
    if (this.state.data.length > 0) {
    orders = this.state.data.map((item) => {
      let tp = '';
      if (item.videoChannel == 1) {
        tp = 'Facetime'
      } else {
        tp = 'Skype'
      }
      return (
        <View key={item.id} style={{borderTopWidth:1,flexDirection:'row',width:'90%',height:'20%',backgroundColor:'white'}}>
          <TouchableOpacity style={{flexDirection:'row',alignItems:'center',justifyContent:'center',width:'14%'}}
          onPress={()=>{this.changevis(item.id,true)}}>
            {item.sex == 'Male'?
            <Image
              style = {{width:20,height:20,marginRight:5}}
              source = {require('../../images/providerImg/Gender-2.png')}
            />
            :
            <Image
              style = {{width:20,height:20,marginRight:5}}
              source = {require('../../images/providerImg/Gender-1.png')}
            />
            }
            <Text style={{fontWeight: '400'}}>{item.customerRealName}</Text>
          </TouchableOpacity>
          <View style={{alignItems:'center',justifyContent:'center',width:'13%'}}>
            <Text style={{fontWeight: '400'}}>{moment(item.appointDate).format('L')}</Text>
          </View>
          <View style={{alignItems:'center',justifyContent:'center',width:'11%'}}>
            <Text style={{fontWeight: '400'}}>{item.startTime&&item.startTime.substring(0,5)}</Text>
          </View>
          <View style={{alignItems:'center',justifyContent:'center',width:'11%'}}>
            <Text style={{fontWeight: '400'}}>{item.serviceTypeName}</Text>
          </View>
          <View style={{alignItems:'center',justifyContent:'center',width:'8%'}}>
            <Text style={{fontWeight: '400'}}>{item.sex}</Text>
          </View>
          <View style={{alignItems:'center',justifyContent:'center',width:'13%'}}>
            <Text style={{fontWeight: '400'}}>{item.birthDate}</Text>
          </View>
          <View style={{alignItems:'center',justifyContent:'center',width:'15%'}}>
            <Text style={{fontWeight: '400'}}>{item.mobile}</Text>
          </View>
          <View style={{flexDirection:'row',alignItems:'center',justifyContent:'center',width:'15%'}}>
            <TouchableOpacity stlye={{margin:5}} onPress={() => this.startAlert(item.id)}>
              <Image
                style = {{width:25,height:25}}
                source={require('../../images/providerImg/Operation-4.png')}
              />
            </TouchableOpacity>
            <TouchableOpacity onPress={() => {
              this.setModalVisible(!this.state.modalVisible);
              this.setState({selectedId:item.id,selectedDoctor:item.businessEmployerId});
            }}>
              <Image
                style = {{marginLeft:'20%',width:25,height:25}}
                source={require('../../images/providerImg/Operation-3.png')}
              />
            </TouchableOpacity>
          </View>
        <Modal
        animationType="slide"
        transparent={true}
        visible={this.findvis(item.id)}
        onRequestClose={() => {
          this.changevis(item.id,false)
        }}
      >
      <View style={{marginTop:250,backgroundColor:"#F7FAFA",borderRadius:40,shadowColor: "#000",
  shadowOffset: {
  width: 0,
  height: 12,
  },
  shadowOpacity: 0.58,
  shadowRadius: 16.00,

  elevation: 24,}}>
    <View style={{flexDirection:"row"}}>
    <TouchableOpacity onPress={() =>{this.changevis(item.id,false)}} style={{marginRight:60,marginLeft:23}}>
      <Image
        style = {styles.arrow_image}
        source={require('../../images/icon/2/Arrow_left.png')}
      />
    </TouchableOpacity>
    </View>
    <ScrollView style={{backgroundColor:"#F7FAFA"}}>
      <View style={{alignItems:'center'}}>
      <View style={{marginTop:30}}>
        <Text style={{marginBottom:10}}>{I18n.t('patientName')}: {item.customerRealName}</Text>
        <Text style={{marginBottom:10}}>{I18n.t('patientMobile')}: {item.mobile}</Text>
